The [CurrencyNetwork](#currencyNetwork) class contains all functions relevant for retrieving currency network related information.
It is meant to be called via a [TLNetwork](#tlNetwork) instance like:
```typescript
const tlNetwork = new TLNetwork(...)
// Get all networks
tlNetwork.currencyNetwork.getAll().then(
 networks => console.log("All networks:", networks)
)
```

The Event class contains all methods related to retrieving event logs.
It is meant to be called via a [[TLNetwork]] instance like:
```typescript
