The Payment class contains all payment related functions. This includes trustline transfers and TLC transfers.
It is meant to be called via a [[TLNetwork]] instance like:
```typescript
const tlNetwork = new TLNetwork(
 //...
)
// Get transfer logs
tlNetwork.payment.get(
 // ...
).then(
 payments => console.log("Payments of loaded user:", payments)
)
```

The [[Trustline]] class contains all relevant methods for retrieving, creating and editing trustlines.
It is meant to be called via a [[TLNetwork]] instance like:
```typescript
const tlNetwork = new TLNetwork(
 //...
)
// Get trustlines
tlNetwork.trustline.getAll(
 // ...
).then(
 trustlines => console.log("Trustlines of loaded user:", trustlines)
)
```

The [User](#user) class contains all user related functions, which also include wallet related methods.
It is meant to be called via a [TLNetwork](#tlNetwork) instance like:
```typescript
const tlNetwork = new TLNetwork(...)
// Create user
tlNetwork.user.create().then(
 newUser => console.log("New user:", newUser)
)
```
